var ets_rv_fo = {
    readURL: function(input) {
        if (input.files && input.files[0]) {
            var reader = new FileReader();
            reader.onload = function(e) {
                $('#ets_rv_avatar_thumbnail > img').attr({
                    'src': e.target.result,
                    'title': input.files[0].name
                }).css('max-width', '110px').addClass('image-loading')
            };
            reader.readAsDataURL(input.files[0])
        }
    },
    copyToClipboard: function(el) {
        var $temp = $("<input>");
        $("body").append($temp);
        $temp.val(el.text()).select();
        document.execCommand("copy");
        $temp.remove();
        el.parent().addClass('copied');
        setTimeout(function() {
            el.removeClass('copy');
            el.parent().removeClass('copied')
        }, 1500)
    },
    isSafari: function() {
        var e = navigator,
            c = e.userAgent,
            g = e.vendor;
        return (!(/(Chrome|CriOS)\s*\/\s*(\d[\d\.]*)/i).test(c) && ((/Apple/i).test(g) || !g) && (/Safari\s*\/\s*(\d[\d\.]*)/i).test(c))
    }
};
var ets_rv_op = {
    initialize: function() {
        if ($('body[id=identity]').length > 0 && $('#customer-form input[name=birthday], #identity input[name=confirmation]').length > 0 && $('.ets_rv_upload_avatar').length > 0) {
            var form_field = $('.ets_rv_upload_avatar .form-group').clone(!0);
            $('#customer-form input[name=birthday], #identity input[name=confirmation]').parents('.form-group').after(form_field);
            $('.ets_rv_upload_avatar').remove()
        }
    },
};
