$(document).ready(function() {
    prestashop.blockcart = prestashop.blockcart || {};
    var showModal = prestashop.blockcart.showModal || function(modal) {
        var $body = $('body');
        $body.append(modal);
        $body.one('click', '#blockcart-modal', function(event) {
            if (event.target.id === 'blockcart-modal') {
                $(event.target).remove()
            }
        })
    };
    prestashop.on('updateCart', function(event) {
        var refreshURL = $('.blockcart').data('refresh-url');
        var requestData = {};
        if (event && event.reason && typeof event.resp !== 'undefined' && !event.resp.hasError) {
            requestData = {
                id_customization: event.reason.idCustomization,
                id_product_attribute: event.reason.idProductAttribute,
                id_product: event.reason.idProduct,
                action: event.reason.linkAction
            }
        }
        if (event && event.resp && event.resp.hasError) {
            prestashop.emit('showErrorNextToAddtoCartButton', {
                errorMessage: event.resp.errors.join('<br/>')
            })
        }
        $.post(refreshURL, requestData).then(function(resp) {
            var html = $('<div />').append($.parseHTML(resp.preview));
            $('.blockcart').replaceWith($(resp.preview).find('.blockcart'));
            if (resp.modal) {
                showModal(resp.modal)
            }
        }).fail(function(resp) {
            prestashop.emit('handleError', {
                eventType: 'updateShoppingCart',
                resp: resp
            })
        })
    })
});
$(document).ready(function() {
    $(document).on('click', '.btn_custom_cart', function(e) {
        $('.choose_alert_message').addClass('active')
    });
    $(document).on('click', '.custom_varriant_dropdown_selected', function(e) {
        $(this).next('.custom_varriant_dropdown_items').addClass('active')
    });
    $(document).on('click', '.custom_select_item_drop', function(e) {
        var selectId = $(this).attr('data-value');
        var selectTitle = $(this).attr('title');
        $(this).parents('.custom_varriant_dropdown').next('.product-variants.js-product-variants').find('select option').attr("selected", "");
        $(this).parents('.custom_varriant_dropdown').next('.product-variants.js-product-variants').find('select option[value="' + selectId + '"]').prop("selected", "selected");
        $(this).parents('.custom_varriant_dropdown').next('.product-variants.js-product-variants').find('select').change();
        $('.custom_varriant_dropdown_selected').html(selectTitle)
    });
    if ($('.sticky_when_scroll').length > 0) {
        var sticky_product_info = $('.description_tabs').offset().top;
        var sticky_addcart = function() {
            var scroll_height = $('.description_tabs').height();
            var scroll_top = $(window).scrollTop();
            if ($(window).width() > 767) {
                if ((scroll_top > sticky_product_info - 100) && (scroll_top < sticky_product_info + scroll_height - 100)) {
                    $('.sticky_when_scroll').addClass('sticky_top')
                } else {
                    $('.sticky_when_scroll').removeClass('sticky_top')
                }
            }
        };
        sticky_addcart();
        $(window).scroll(function() {
            sticky_addcart()
        })
    }
    $(document).on('click', '.support-closing', function(e) {
        $(this).parent().addClass('open_list_support')
    });
    $(document).on('click', '.support-opening', function(e) {
        $(this).parent().removeClass('open_list_support')
    });
    $(document).on('click', '.tab_title', function(e) {
        e.preventDefault();
        var tab_active = $(this).attr('href');
        if ($(this).hasClass('active')) {
            $(this).removeClass('active');
            $(tab_active).removeClass('active')
        } else {
            $('.description_tabs_item .tab_title').removeClass('active');
            $('.description_tabs_item .tab-pane').removeClass('active');
            $(this).addClass('active');
            $(tab_active).addClass('active')
        }
    });
    $(document).on('click', '.size_guide', function(e) {
        $(this).parent().stop().toggleClass('active')
    });
    if ($('.cungmenh_wrap').length > 0) {
        $('.cungmenh_wrap').flickity({
            cellAlign: 'left',
            contain: !0,
            freeScroll: !0,
            prevNextButtons: !0,
            pageDots: !1
        })
    }
    if ($('.panel_services_2 .home-row').length > 0) {
        $('.panel_services_2 .home-row').flickity({
            cellAlign: 'left',
            contain: !0,
            freeScroll: !0,
            prevNextButtons: !1,
            pageDots: !1
        })
    }
    if ($('#subcategories ul').length > 0) {
        $('#subcategories ul').flickity({
            cellAlign: 'center',
            contain: !0,
            freeScroll: !0,
            prevNextButtons: !1,
            pageDots: !1
        })
    }
})